    sw3Pressed = true; // Set SW3 aktif
    context.set('SW3', sw3Pressed);

    // Delay 1 detik sebelum menjalankan animasi
    setTimeout(() => {
        // Jalankan animasi setelah 1 detik
        node.send({
            payload: {
                command: "trigger_animation",
                selector: "#motor_reverse", // Animasi motor mundur
                action: "start"
            }
        });

        // Reset status SW3 setelah animasi dimulai
        context.set('SW3', false);
    }, 1000); // Delay 1 detik
}

return null;

// Versi 1 
// Variabel global untuk interval dan waktu dalam detik
let interval = context.get("interval") || null; // Ambil nilai interval dari konteks
let seconds = context.get("seconds") || 0; // Ambil waktu terakhir dalam detik dari konteks

// Fungsi untuk mengonversi detik ke format hh:mm:ss
function formatTime(sec) {
    let hours = Math.floor(sec / 3600); // Hitung jam
    let minutes = Math.floor((sec % 3600) / 60); // Hitung menit
    let seconds = sec % 60; // Sisa detik

    // Format dengan padding angka (misal: 01:02:03)
    return `${hours.toString().padStart(2, '0')}:${minutes.toString().padStart(2, '0')}:${seconds.toString().padStart(2, '0')}`;
}

if (msg.payload === "ON") {
    // Jika tombol "mulai" ditekan
    if (!interval) {
        interval = setInterval(() => {
            seconds++; // Tambah waktu dalam detik
            const formattedTime = formatTime(seconds); // Format waktu menjadi hh:mm:ss
            node.send({ payload: formattedTime }); // Kirim waktu ke node berikutnya
            context.set("seconds", seconds); // Simpan waktu ke konteks
        }, 1000); // Interval 1 detik
        context.set("interval", interval); // Simpan ID interval ke konteks
        node.status({ fill: "green", shape: "dot", text: "Menghitung..." });
    }
} else if (msg.payload === "OFF") {
    // Jika tombol "stop" ditekan
    if (interval) {
        clearInterval(interval); // Hentikan interval
        context.set("interval", null); // Reset interval di konteks
        interval = null; // Reset interval lokal
        node.status({ fill: "red", shape: "ring", text: "Berhenti" });
    }
} else if (msg.payload === "reset") {
    // Jika tombol "reset" ditekan
    if (interval) {
        clearInterval(interval); // Hentikan interval jika berjalan
        context.set("interval", null); // Reset interval di konteks
        interval = null; // Reset interval lokal
    }
    seconds = 0; // Reset waktu ke 0 detik
    context.set("seconds", seconds); // Simpan waktu ke konteks
    node.send({ payload: formatTime(seconds) }); // Kirim waktu nol dalam format hh:mm:ss
    node.status({ fill: "blue", shape: "dot", text: "Di-reset" });
}



